export class PartSignature {
    config;
    log;
    staveCount;
    constructor(config, log, staveCount) {
        this.config = config;
        this.log = log;
        this.staveCount = staveCount;
    }
    parse() {
        return {
            type: 'partsignature',
            staveCount: this.staveCount.getValue(),
        };
    }
}
